/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import Zoom from "../images/zoom.png";
import GitHubButton from "react-github-btn";

const ContactDiv = styled.div`
  background: url(${Zoom}) no-repeat;
  bottom: 0;
  z-index: 8000;
`;

function Contact() {
  return (
    <ContactDiv>
      <div>
        <h2>Lets get in touch</h2>
        <br />
        <p>hello@johnschriemer.com</p>
        <GitHubButton
          href="https://github.com/jschriemer/jschriemer.github.io"
          data-color-scheme="no-preference: dark_dimmed; light: dark; dark: dark_dimmed;"
          data-size="large"
          data-show-count="true"
          aria-label="Star jschriemer/jschriemer.github.io on GitHub"
        >
          Star
        </GitHubButton>
      </div>
      {/*<Scroll>Scroll &#8594;</Scroll>*/}
    </ContactDiv>
  );
}

export default Contact;
